import { Card, List } from "antd";
import React from "react";
import { useSelector } from "react-redux";

const AllPosts = ({post}) => {

    const {mainPosts} = useSelector((state) => state.post);

    return(
        <>
        <List 
        grid={{
            gutter: 16,
            column: 4
        }}
        dataSource={mainPosts}
        renderItem={(item) => (
            <List.Item>
                <Card title={item.lookName}>

                </Card>
            </List.Item>
        )}
        />
        </>
    );

};

export default AllPosts;
